import React, {useEffect, useState} from 'react';

import './WorldPage.scss'
import './SystemPage.scss'
import {S1, S2, S3, S4} from 'components/atom/system';

export type SystemPageProps = {
    cx? : string
}

export const SystemPage: React.FC < SystemPageProps > = ({cx = ""}) => {
    const [select, setSelect] = useState(0);

    useEffect(() => {
        window.scrollTo(0, 0)
    }, [])
    return (
        <main className={`WorldPage ${cx}`}>
            <section className={"system-image"}>
            <img src="data:img/png;base64," />
            </section>
            <section className={`tab-wrapper _${select}`}>
                <div className="tab t0" onClick={() => setSelect(0)}>
                    <h5>스토리</h5>
                </div>
                <div className="tab t1" onClick={() => setSelect(1)}>
                    <h5>직군과 성장치</h5>
                </div>
                <div className="tab t2" onClick={() => setSelect(2)}>
                    <h5>레이드</h5>
                </div>
                <div className="tab t3" onClick={() => setSelect(3)}>
                    <h5>퀘스트</h5>
                </div>
            </section>
            {select === 0 && <S1 />}
            {select === 1 && <S2 />}
            {select === 2 && <S3 />}
            {select === 3 && <S4 />}
        </main>
    )
};